import React from "react";

const Welcome = (props) => {
  return(
    <div>
      <h2>Welcome {props.name}</h2>
      <h3>I have {props.age} Years.</h3>
      </div>
  );
}

function App(){
  return(
    <div>
      {/* <Welcome name="Dayanna" age="27"/> */}
      <h1>Using React!</h1>
    </div>
  );
}

export default App;
